import {
	Box,
	Button,
	FormControl,
	FormLabel,
	Input,
	VStack,
} from "@chakra-ui/react";

function LoginPage() {
	const handleClick = () => {
		fetch("/api/login", {}).then();
	};

	return (
		<Box margin="20">
			<FormControl>
				<VStack spacing="5">
					<Box width="50%">
						<FormLabel>User ID</FormLabel>
						<Input />
					</Box>

					<Box width="50%">
						<FormLabel>Password</FormLabel>
						<Input />
					</Box>
					<Box>
						<Button type="submit" onClick={handleClick}>
							Submit
						</Button>
					</Box>
				</VStack>
			</FormControl>
		</Box>
	);
}

export default LoginPage;
